import * as React from 'react';

interface Prop {
  img: string;
  verified: number;
  description: string;
}

export const FeaturedCard: React.FC<Prop> = ({
  img,
  verified,
  description
}) => {
  return (
    <div className=''>
      <div className='w-full'>
        <div className='relative'>
          <div>
            <img
              className='w-full h-full rounded-xl'
              src={img}
              alt='adventure1'
            />
          </div>
          <div>
            <svg
              className='w-full h-full'
              viewBox='0 0 470 239'
              style={{ fill: '#3C3C41' }}></svg>
          </div>
          <div>
            <svg></svg>
          </div>
        </div>

        <div className='mt-2 mb-1'>
          <p
            style={{ fontFamily: 'airbnb-bold' }}
            className='uppercase text-xs text-pink-700'>
            {verified}+ Verified Stays
          </p>
        </div>
        <div className='flex flex-wrap items-center'>
          <p
            style={{ fontFamily: 'airbnb-book' }}
            className='whitespace-normal text-sm tracking-wide'>
            {description}
          </p>
        </div>
      </div>
    </div>
  );
};
